    public static class TravelsDbContextSeedData
    {
        static object synchlock = new object();
        static volatile bool seeded = false;

        public static void EnsureSeedData(this TravelsDbContext context)
        {
            if (!seeded && context.Travels.Count() == 0)
            {
                lock (synchlock)
                {
                    if (!seeded)
                    {
                        var travels = GenerateTravels();
                        context.Travels.AddRange(travels);
                        context.SaveChanges();
                        seeded = true;
                    }
                }
            }
        }

